import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import MyHeader from './MyHeader';
import HeroSection from './HeroSection';
import TeamSection from './TeamSection';
import ConuAISection from './ConuAISection';
import AboutSection from './AboutSection';
import EventCards from './EventCards';
import CallToActionSection from './CallToActionSection';
import MyFooter from './MyFooter';
import QuantFundSection from './QuantFundSection';
import BoardMembersSection from './BoardMembersSection';
import FundManagersSection from './FundManagersSection';
import AnalystsSection from './AnalystsSection';
import AlumniSection from './AlumniSection';

function App() {
    return (
        <Router>
            <div className="flex relative flex-col min-h-screen [background-color:oklch(97.69%_0.00107_-72.824)]">
                <MyHeader />
                <main className="flex-auto">
                    <div className="px-6 w-full mx-auto max-w-7xl">
                        <Routes>
                            <Route path="/" element={
                                <>
                                    <HeroSection />
                                    <CallToActionSection />
                                </>
                            } />
                            <Route path="/about" element={<AboutSection />} />
                            <Route path="/team" element={<TeamSection />} />
                            <Route path="/activities" element={<EventCards />} />
                            <Route path="/conuai" element={<ConuAISection />} />
                            <Route path="/quantfund" element={
                                <div className="pt-24">
                                    <AboutSection />
                                    <BoardMembersSection />
                                    <FundManagersSection />
                                    <AnalystsSection />
                                    <AlumniSection />
                                </div>
                            } />
                        </Routes>
                    </div>
                </main>
                <MyFooter />
            </div>
        </Router>
    );
}

export default App;
